import styled from 'styled-components';
import {MainLayout} from '../../components/MainLayout';

const StyledHeader = styled.h1`
  font-size: 2em;
  text-align: left;
  padding: 16px 16px;
`;

const Index = () => {
  return (
    <MainLayout>
      <StyledHeader>Index Page</StyledHeader>
    </MainLayout>
  );
};

export default Index;
